import React, { useState, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Container,
  Paper,
  Grid,
  Card,
  CardContent,
  Chip,
  Avatar,
  LinearProgress,
} from '@mui/material';
import { 
  GitHub, 
  LinkedIn, 
  Email,
  School,
  Work,
  LocationOn,
  Web,
  Storage,
  CloudQueue,
  PhoneAndroid,
} from '@mui/icons-material';
import Navbar from "../components/Navbar";

export default function HomePage() {
  const [text, setText] = useState('');
  const [isDeleting, setIsDeleting] = useState(false);
  const [loopNum, setLoopNum] = useState(0);
  const [typingSpeed, setTypingSpeed] = useState(150);
  const navigate = useNavigate();

  // Smooth scroll function
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({
        behavior: 'smooth',
        block: 'start',
      });
    }
  };

  useEffect(() => {
    const roles = ['Computer Science Student', 'Full Stack Developer', 'Problem Solver', 'Tech Enthusiast'];

    const handleType = () => {
      const current = loopNum % roles.length;
      const fullText = roles[current];

      setText(isDeleting 
        ? fullText.substring(0, text.length - 1)
        : fullText.substring(0, text.length + 1)
      );

      setTypingSpeed(isDeleting ? 30 : 150);

      if (!isDeleting && text === fullText) {
        setTimeout(() => setIsDeleting(true), 500);
      } else if (isDeleting && text === '') {
        setIsDeleting(false);
        setLoopNum(loopNum + 1);
      }
    };

    const timer = setTimeout(handleType, typingSpeed);
    return () => clearTimeout(timer);
  }, [text, isDeleting, loopNum, typingSpeed]);

  const codeLines = [
    { keyword: 'const', variable: ' developer', operator: ' = ', string: '"passionate"', punctuation: ';' },
    { keyword: 'const', variable: ' skills', operator: ' = ', string: '["React", "Node.js", "Python"]', punctuation: ';' },
    { keyword: 'const', variable: ' passion', operator: ' = ', string: '"building amazing things"', punctuation: ';' },
    { keyword: 'function', variable: ' createImpact', operator: '() {', string: '', punctuation: '' },
    { keyword: '  return', variable: ' innovation', operator: ' + ', string: 'dedication', punctuation: ';' },
    { keyword: '}', variable: '', operator: '', string: '', punctuation: '' },
  ];

  // About section data
  const stats = [
    { label: 'Years of Study', value: '3+', icon: <School /> },
    { label: 'Projects Completed', value: '15+', icon: <Work /> },
    { label: 'Technologies Learned', value: '20+', icon: <School /> },
    { label: 'Coffee Cups', value: 'âˆž', icon: <Work /> },
  ];

  const interests = [
    'Web Development', 'Machine Learning', 'Mobile Apps', 'UI/UX Design',
    'Open Source', 'Gaming', 'Music', 'Photography', 'Travel', 'Reading'
  ];

  // Skills section data
  const skillCategories = [
    {
      title: 'Frontend Development',
      icon: <Web />,
      skills: [
        { name: 'React', level: 90 },
        { name: 'JavaScript', level: 85 },
        { name: 'HTML/CSS', level: 95 },
        { name: 'TypeScript', level: 75 },
        { name: 'Material-UI', level: 80 },
      ],
    },
    {
      title: 'Backend Development',
      icon: <Storage />,
      skills: [
        { name: 'Node.js', level: 80 },
        { name: 'Python', level: 85 },
        { name: 'Express.js', level: 75 },
        { name: 'REST APIs', level: 80 },
        { name: 'GraphQL', level: 60 },
      ],
    },
    {
      title: 'Database & Cloud',
      icon: <CloudQueue />,
      skills: [
        { name: 'MongoDB', level: 75 },
        { name: 'PostgreSQL', level: 70 },
        { name: 'Firebase', level: 80 },
        { name: 'AWS', level: 65 },
        { name: 'Docker', level: 60 },
      ],
    },
    {
      title: 'Mobile & Tools',
      icon: <PhoneAndroid />,
      skills: [
        { name: 'React Native', level: 70 },
        { name: 'Git/GitHub', level: 90 },
        { name: 'VS Code', level: 95 },
        { name: 'Figma', level: 75 },
        { name: 'Postman', level: 85 },
      ],
    },
  ];

  const currentlyLearning = [
    'Next.js',
    'Kubernetes',
    'TensorFlow',
    'Go Programming',
  ];

  const learningGoals = [
    'Machine Learning with Python',
    'DevOps and CI/CD',
    'Microservices Architecture',
    'Advanced React Patterns',
    'System Design',
    'Blockchain Development',
  ];

  return (
    <div className="full-page-theme">
      <Navbar scrollToSection={scrollToSection} />
      <main className="main-flex">
        <Container maxWidth="lg">
          <Box sx={{ textAlign: { xs: 'center', md: 'left' } }}>
            <Typography
              variant="h1"
              sx={{
                fontSize: { xs: '2.5rem', md: '3.5rem', lg: '4rem' },
                fontWeight: 700,
                mb: 2,
                background: 'linear-gradient(45deg, #ffffff, #e3f2fd)',
                backgroundClip: 'text',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
              }}
            >
              Hi, I'm Janidu
            </Typography>

            <Box sx={{ mb: 3, minHeight: '60px' }}>
              <Typography
                variant="h2"
                sx={{
                  fontSize: { xs: '1.5rem', md: '2rem' },
                  color: 'primary.main',
                  fontWeight: 500,
                }}
              >
                {text}
                <Box
                  component="span"
                  sx={{
                    animation: 'blink 1s infinite',
                    '@keyframes blink': {
                      '0%, 50%': { opacity: 1 },
                      '51%, 100%': { opacity: 0 },
                    },
                  }}
                >
                  |
                </Box>
              </Typography>
            </Box>

            <Typography
              variant="body1"
              sx={{
                mb: 4,
                maxWidth: 500,
                mx: { xs: 'auto', md: 0 },
                color: 'text.secondary',
                fontSize: '1.1rem',
                lineHeight: 1.6,
              }}
            >
              Passionate about creating innovative solutions and building amazing web applications. 
              Currently pursuing Computer Science and always eager to learn new technologies.
            </Typography>

            <Box sx={{ display: 'flex', gap: 2, mb: 4, justifyContent: { xs: 'center', md: 'flex-start' } }}>
              <Button
                variant="contained"
                size="large"
                onClick={() => scrollToSection('about')}
                sx={{
                  px: 4,
                  py: 1.5,
                  borderRadius: 2,
                  textTransform: 'none',
                  fontSize: '1.1rem',
                }}
              >
                Learn About Me
              </Button>
              <Button
                variant="outlined"
                size="large"
                onClick={() => navigate('/contact')}
                sx={{
                  px: 4,
                  py: 1.5,
                  borderRadius: 2,
                  textTransform: 'none',
                  fontSize: '1.1rem',
                }}
              >
                Get In Touch
              </Button>
            </Box>

            <Box sx={{ display: 'flex', gap: 2, justifyContent: { xs: 'center', md: 'flex-start' } }}>
              <Button
                href="https://github.com/JaniduP2003"
                target="_blank"
                startIcon={<GitHub />}
                sx={{ color: 'text.secondary' }}
              >
                GitHub
              </Button>
              <Button
                href="https://linkedin.com/in/janidu-peiris"
                target="_blank"
                startIcon={<LinkedIn />}
                sx={{ color: 'text.secondary' }}
              >
                LinkedIn
              </Button>
              <Button
                href="mailto:janidupeiris2003@gmail.com"
                startIcon={<Email />}
                sx={{ color: 'text.secondary' }}
              >
                Email
              </Button>
            </Box>
          </Box>
        </Container>
      </main>

      <main className="main-flex2">
        <Container maxWidth="md">
          <Paper
            elevation={3}
            sx={{
              p: 3,
              backgroundColor: 'background.paper',
              backdropFilter: 'blur(10px)',
              borderRadius: 2,
              border: '1px solid rgba(255, 255, 255, 0.1)',
            }}
          >
            <Typography
              variant="h6"
              sx={{ mb: 2, color: 'primary.main', fontFamily: 'monospace' }}
            >
              // Current Focus
            </Typography>
            <Box sx={{ fontFamily: 'monospace', fontSize: '0.9rem' }}>
              {codeLines.map((line, index) => (
                <Box key={index} sx={{ mb: 0.5 }}>
                  <Box component="span" sx={{ color: 'primary.main' }}>{line.keyword}</Box>
                  <Box component="span" sx={{ color: 'text.primary' }}>{line.variable}</Box>
                  <Box component="span" sx={{ color: 'primary.main' }}>{line.operator}</Box>
                  <Box component="span" sx={{ color: 'secondary.main' }}>{line.string}</Box>
                  <Box component="span" sx={{ color: 'text.primary' }}>{line.punctuation}</Box>
                </Box>
              ))}
            </Box>
          </Paper>
        </Container>
      </main>

      {/* About Section */}
      <section id="about">
        <main className="main-flex2">
          <Container maxWidth="lg">
            <Typography
              variant="h2"
              sx={{
                textAlign: 'center',
                mb: 6,
                fontWeight: 700,
                background: 'linear-gradient(45deg, #ffffff, #e3f2fd)',
                backgroundClip: 'text',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
              }}
            >
              About Me
            </Typography>

            <Grid container spacing={4}>
              {/* Profile Section */}
              <Grid item xs={12} md={4}>
                <Card
                  sx={{
                    p: 3,
                    textAlign: 'center',
                    backgroundColor: 'background.paper',
                    backdropFilter: 'blur(10px)',
                    border: '1px solid rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <Avatar
                    sx={{
                      width: 120,
                      height: 120,
                      mx: 'auto',
                      mb: 2,
                      bgcolor: 'primary.main',
                      fontSize: '3rem',
                    }}
                  >
                    JP
                  </Avatar>
                  <Typography variant="h5" sx={{ mb: 1, fontWeight: 600 }}>
                    Janidu Pabasara
                  </Typography>
                  <Typography variant="body2" sx={{ color: 'text.secondary', mb: 2 }}>
                    Computer Science Student
                  </Typography>
                  <Box sx={{ display: 'flex', flexDirection: 'column', gap: 1 }}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, justifyContent: 'center' }}>
                      <LocationOn fontSize="small" />
                      <Typography variant="body2">Sri Lanka</Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, justifyContent: 'center' }}>
                      <Email fontSize="small" />
                      <Typography variant="body2">janidupeiris2003@gmail.com</Typography>
                    </Box>
                  </Box>
                </Card>
              </Grid>

              {/* Bio Section */}
              <Grid item xs={12} md={8}>
                <Card
                  sx={{
                    p: 3,
                    backgroundColor: 'background.paper',
                    backdropFilter: 'blur(10px)',
                    border: '1px solid rgba(255, 255, 255, 0.1)',
                  }}
                >
                  <Typography variant="h5" sx={{ mb: 3, fontWeight: 600 }}>
                    My Story
                  </Typography>
                  <Typography variant="body1" sx={{ mb: 3, lineHeight: 1.7 }}>
                    I'm a passionate Computer Science student with a deep love for creating innovative 
                    digital solutions. My journey in technology began with curiosity about how things work, 
                    and has evolved into a commitment to building applications that make a difference.
                  </Typography>
                  <Typography variant="body1" sx={{ mb: 3, lineHeight: 1.7 }}>
                    Currently pursuing my degree in Computer Science, I've gained hands-on experience 
                    in full-stack development, working with modern technologies like React, Node.js, 
                    Python, and various databases. I believe in writing clean, efficient code and 
                    creating user experiences that are both functional and delightful.
                  </Typography>
                  <Typography variant="body1" sx={{ lineHeight: 1.7 }}>
                    When I'm not coding, you'll find me exploring new technologies, contributing to 
                    open-source projects, or enjoying music and gaming. I'm always eager to learn, 
                    collaborate, and take on new challenges that push me to grow as a developer.
                  </Typography>
                </Card>
              </Grid>
            </Grid>
          </Container>
        </main>

        <main className="main-grid">
          {stats.map((stat, index) => (
            <Card
              key={index}
              sx={{
                p: 3,
                textAlign: 'center',
                backgroundColor: 'background.paper',
                backdropFilter: 'blur(10px)',
                border: '1px solid rgba(255, 255, 255, 0.1)',
                transition: 'transform 0.3s ease',
                '&:hover': {
                  transform: 'translateY(-5px)',
                },
              }}
            >
              <Box sx={{ color: 'primary.main', mb: 2, fontSize: '2rem' }}>
                {stat.icon}
              </Box>
              <Typography variant="h3" sx={{ fontWeight: 700, mb: 1 }}>
                {stat.value}
              </Typography>
              <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                {stat.label}
              </Typography>
            </Card>
          ))}
        </main>

        <main className="main-flex3">
          <Container maxWidth="md">
            <Typography
              variant="h4"
              sx={{
                textAlign: 'center',
                mb: 4,
                fontWeight: 600,
              }}
            >
              Interests & Hobbies
            </Typography>
            <Box
              sx={{
                display: 'flex',
                flexWrap: 'wrap',
                gap: 2,
                justifyContent: 'center',
              }}
            >
              {interests.map((interest, index) => (
                <Chip
                  key={index}
                  label={interest}
                  variant="outlined"
                  sx={{
                    borderColor: 'primary.main',
                    color: 'primary.main',
                    '&:hover': {
                      backgroundColor: 'primary.main',
                      color: 'primary.contrastText',
                    },
                  }}
                />
              ))}
            </Box>
          </Container>
        </main>
      </section>

      {/* Skills Section */    }
      <section id="skills">
        <main className="main-flex2">
          <Container maxWidth="lg">
            <Typography
              variant="h2"
